import React from 'react';
import { Route, Switch } from 'react-router';
import Home from './Component/Home';
import Encyclo from './Component/Encyclo';
const App=()=>{
  return(
    <>
    <Switch>
      <Route path="/" component={Home} />
      <Route path="/encyclopedie" component={Encyclo} />
    </Switch>
    </>

  )
}
export default App;
